(3, 'node', 'Nodejs send stream via email', 'I\'m trying to send my stream data via email using Nodemailer but for some reason, the attachment is coming up as 0 kb when I download it and look at its info. How can I properly send the stream & it\'s data as an attachment? The stream should contain a PKPass is it a better option to send the response as an attachment? I\'m using passkit-generator to generate the PKPass', '2020-06-09', 5, '109445', );
INSERT INTO `posts` (`id`, `techRelated`, `title`, `qbody`, `dateCreated`, `upvotes`, `personId`, `imgRelated`) VALUES
(4, 'flutter', 'Aligning text in AppBar button', 'I\'m trying to align a text in a button positioned in action property of AppBar,I want the text to be on the right..\r\nAppBar(\r\n        title: Text(\'Profile\'),\r\n        actions: <Widget>[\r\n          FlatButton(\r\n            color: Colors.red,\r\n            padding: EdgeInsets.zero,\r\n            child: Align(\r\n              alignment: Alignment.centerRight,\r\n              child: Text(\r\n                \'Done\',\r\n                textAlign: TextAlign.right,\r\n              ),\r\n            ),\r\n            onPressed: () {},\r\n          )\r\n        ],\r\n      )\r\nI have even tried MaterialRawButton with same ', '2020-06-16', 0, '109449', );
INSERT INTO `posts` (`id`, `techRelated`, `title`, `qbody`, `dateCreated`, `upvotes`, `personId`, `imgRelated`) VALUES
(5, 'Python, Data science', 'Python/Pandas Dataframe - Calculate the difference of two far apart rows in a dataframe based on identifier', 'I am working on a dataframe in python (mostly pandas and numpy). Example is given below.\r\n  Name   ID   Guess  Date  Topic                       Delta\r\n    0    a     23    5     2019    1    (Person A\'s Guess in 2019 - Guess in 2018)\r\n    1    a     23    8     2018    1\r\n    2    c     7     7     2019    1    (Person C\'s Guess in 2019 - Guess in 2018)\r\n    3    c     7     4     2018    1\r\n    4    e     12    9     2018    1\r\n    5    a     23    3     2020    2\r\nI want to fill the empty column Delta, which is just the difference between the last guess on the same topic and the now updated', '2020-06-20', 7, '109450', );
